  false,\n\t\"url\": null,\n\t\"notes\": \"CENSUS_TRACTS_TIGER2011_IN.SHP is a polygon
  shapefile that contains 2011 census tract boundaries for the state of Indiana. Census
  tracts are not legal boundaries, but are considered stable geographic units used
  for the presentation of decennial census data. The following is excerpted from an
  Adobe Acrobat PDF document named \"TGRSHP2011_TECHDOC.PDF (U.S. Census Bureau):
  \"Census tracts are small, relatively permanent statistical subdivisions of a county
  or equivalent entity, and are reviewed and updated by local participants prior to
  each decennial census as part of the Census Bureau's Participant Statistical Areas
  Program. The Census Bureau updates census tracts in situations where no local participant
  existed or where local or tribal governments declined to participate. The primary
  purpose of census tracts is to provide a stable set of geographic units for the
  presentation of decennial census data. \"Census tracts generally have a population
  size between 1,200 and 8,000 people with an optimum size of 4,000 people. The spatial
  size of census tracts varies widely depending on the density of settlement. Census
  tracts are delineated with the intention of being maintained over a long time so
  that statistical comparisons can be made from census to census. However, physical
  changes in street patterns caused by highway construction, new development, and
  so forth, may require boundary revisions. In addition, census tracts occasionally
  are split due to population growth, or combined as a result of substantial population
  decline. \"Census tract boundaries generally follow visible and identifiable features.
  They may follow legal boundaries such as minor civil division (MCD) or incorporated
  place boundaries in some states and situations to allow for census tract-to-governmental
  unit relationships where the governmental boundaries tend to remain unchanged between
  censuses. State and county boundaries always are census tract boundaries in the
  standard census geographic hierarchy.\"\",\n\t\"license_title\": null,\n\t\"extras\":
